# few_shot_classifier.load_state_dict(torch.load(net_state_dict))

best_state = few_shot_classifier.state_dict()
best_validation_accuracy = 0.0
loss = []
valAccuracy = []
few_shot_classifier.use_softmax = True
for epoch in range(n_epochs):
    if epoch == 0:
        torch.save(few_shot_classifier.state_dict(), "./data/Pascal/New/FewShotResNet18Softmax_" + str(epoch))
    print(f"Epoch {epoch}")
    average_loss = training_epoch(few_shot_classifier, train_loader, train_optimizer)
    validation_accuracy = evaluate(
        few_shot_classifier, val_loader, device=DEVICE, tqdm_prefix="Validation"
    )
    loss.append(average_loss)
    valAccuracy.append(validation_accuracy)
    if validation_accuracy > best_validation_accuracy:
        best_validation_accuracy = validation_accuracy
        best_state = few_shot_classifier.state_dict()
        print("Ding ding ding! We found a new best model!")

    tb_writer.add_scalar("Train/loss", average_loss, epoch)
    tb_writer.add_scalar("Val/acc", validation_accuracy, epoch)

    # Warn the scheduler that we did an epoch
    # so it knows when to decrease the learning rate

    # if epoch % 50 ==49:
    #     pass

    if epoch % 200 == 199:
        accuracy = evaluate(few_shot_classifier, test_loader, device=DEVICE)
        torch.save(few_shot_classifier.state_dict(), "./data/Pascal/New/FewShotResNet18Softmax_" + str(epoch))
        print(f"Average accuracy for current model: {(100 * accuracy):.2f} %")
        print('Loss is')
        print(loss)
        print('ValAccuracy is')
        print(valAccuracy)
        # plt.plot(loss)
        # plt.show(block=True)

    train_scheduler.step()
    torch.cuda.empty_cache()

print('Loss is')
